import React from "react";
import {
  CardContainer,
  CardImg,
  CardName,
  CardTypes,
  CardType,
} from "./PokemonCardElements";
import archen from "../../assets/images/archen.png";
const PokemonCard = () => {
  return (
    <CardContainer>
      <CardImg src={archen} />
      <CardName>Archen</CardName>
      <CardTypes>
        <CardType bgcolor="#A38C21;">Rock</CardType>
      </CardTypes>
    </CardContainer>
  );
};

export default PokemonCard;
